import React from "react";
import { NavLink } from "react-router-dom";
import Logo from "./../assets/logo.png"


const Footer = () => {
    return (
    <div className="footer">
        <img className="logo_footer" src={Logo} alt=""/>
        <NavLink to="/">Main</NavLink>
    </div>
    )
}


export default Footer
